No conozco la continuación exacta de este poema. Es un soneto de la época barroca, probablemente de un autor español del siglo XVII, pero no puedo completar los siguientes versos con certeza.

Lo que sí puedo observar es que el fragmento que has compartido es un soneto, con un estilo típico del Barroco, con personificación de animales (el ruiseñor y la tórtola) y un lenguaje metafórico y culterano.
